        };
        this.sizeForThickness = {
            [thickness.small] : '40px',
            [thickness.medium] : '60px',
            [thickness.large] : '80px',
            [thickness.xLarge] : '100px',
        };
    }
    componentDidMount() {

    }
    componentDidUpdate() {

    }
    render() {
        const thicknessDivs = Object.keys(thickness).map(thicknessValue => {
            size = this.sizeForThickness[thicknessValue];
            return (
                <div className='ThickPalette-thickness' id={thicknessValue} key={thicknessValue} style={{width: size, height: size}} />
            )
        });
        return (
            <div className='ThickPalette-container'>
                <div className='ThickPalette-title'>
                    Thickness:
                </div>
                <div className='ThickPalette-column'>
                    {thicknessDivs}
                </div>
            </div>
        )
    }
}
